import React, { useState } from 'react';
import styled from 'styled-components';
import Button from './navitem';
import { FaKey, FaEye, FaUser } from 'react-icons/fa';
import LottieAnimation from '../LottieAnimation';
import ActionVerite from '../ActionVerite';
import Roleplay from '../Roleplay';

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  position: absolute;
  left: 48px;
  top: 48px;
  gap: 10px;
`;

const NewPageContent = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  font-size: 2em;
  color: #333;
  flex-direction: column;
`;

const NavbarLeft = () => {
  const [isLottieVisible, setLottieVisible] = useState(false);
  const [isNewPageVisible, setNewPageVisible] = useState(false);
  const [selectedButton, setSelectedButton] = useState(null);

  const handleButtonClick = (button) => {
    setSelectedButton(button);
    setLottieVisible(true);
  };

  const handleAnimationComplete = () => {
    setLottieVisible(false);
    setNewPageVisible(true);
  };

  const getLottieData = () => {
    switch (selectedButton) {
      case 'button1':
        return require('../../test.json'); 
      case 'button2':
        return require('../../test.json'); 
      case 'button3':
        return require('../test.json'); 
      default:
        return null;
    }
  };

  const getNewContent = () => {
    switch (selectedButton) {
      case 'button1':
        return <ActionVerite />; 
      case 'button2':
        return <div>New content for Button 2</div>;
      case 'button3':
        return <Roleplay />; 
      default:
        return null;
    }
  };

  return (
    <>
      {!isLottieVisible && !isNewPageVisible && (
        <Wrapper>
          <Button icon={<FaKey />} label="Truth & Dare" onClick={() => handleButtonClick('button1')} />
          <Button icon={<FaEye />} label="Positions" onClick={() => handleButtonClick('button2')} />
          <Button icon={<FaUser />} label="RÃ´le" onClick={() => handleButtonClick('button3')} />
        </Wrapper>
      )}

      {isLottieVisible && (
        <LottieAnimation
          animationData={getLottieData()}
          onComplete={handleAnimationComplete}
        />
      )}

      {!isLottieVisible && isNewPageVisible && (
        <NewPageContent>
          {getNewContent()}
        </NewPageContent>
      )}
    </>
  );
};

export default NavbarLeft;
